import './kb.scss';
import WKey from "./w-key";
import BKey from "./b-key";

export default function Keyboard() {    
    return (      
        <div className='keyboard'>
            <WKey onClick={() => keyPress('F')}/>
                <BKey />
            <WKey onClick={() => keyPress('G')}/>
                <BKey />
            <WKey onClick={() => keyPress('A')}/>
                <BKey />
            <WKey onClick={() => keyPress('B')}/>
            <WKey onClick={() => keyPress('C')}/>
                <BKey />
            <WKey onClick={() => keyPress('D')}/>
                <BKey />
            <WKey onClick={() => alert('You clicked me')}/>
        </div>
    );
}
